import React from "react";

const UserCard = () => {
  return (
    <figure className="user-card">
      <img src="https://i.pinimg.com/564x/70/50/a3/7050a30cc61e8a7f3f8677ebf9505db7.jpg" />
      <figcaption>Aishwarya Rai</figcaption>
    </figure>
  );
};

export default UserCard;
